import React from 'react';
import HeaderTwo from '../../components/header/HeaderTwo';
import Footer from '../../components/footer/Footer';
import Breadcrumb from '../teampage/Breadcrumb';
import AboutInner from '../aboutpage/aboutuspage/AboutInner'
import LatestMatch from '../aboutpage/aboutuspage/LatestMatch'
import TeamMem from '../teampage/TeamMem'
import TeamArea from '../teampage/TeamArea'

function AboutUs() {
  return (
	<>
	<HeaderTwo/>
	<main>
	<Breadcrumb/>
	{/* <AboutInner/> */}
	{/* <LatestMatch/> */}
	<TeamMem/>
    <TeamArea/>
	
	</main>
	<Footer/>
	</>
  )
}

export default AboutUs
